    [],nt"num_tags": 6,nt"name": "red-rock-lakes-national-wildlife-refuge-annual-narrative-report-calendar-year-1989",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Red Rock
    Lakes National Wildlife Refuge outlines Refuge accomplishments during the 1989 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    compliance with environmental and cultural resource mandates and research and investigations.
    Refuge administration is outlined; information about personnel, volunteer programs,
    funding, safety, and technical assistance is given. Habitat management is also covered;
    subjects include wetlands, grasslands, grazing, fire management, water rights, and
    wilderness and special areas. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, other migratory birds, game mammals, fisheries resources, propagation
    and stocking, scientific collections, marking and banding, and disease prevention
    and control. The public uses of the Refuge described in this report include hunting,
    fishing, camping, and law enforcement. The equipment and facilities section of the
    report provides information about new construction, rehabilitation and equipment
    utilization and replacement. Cooperative programs and discussed. Field guides are
    attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
